import React, { Component } from 'react';
import ItemsList from '../ItemsList/ItemsList'
import styles from './TableRow.module.css';

class TableRow extends Component {
    render() {
        return (
            <tr>
                <td>{this.props.codeName}</td>
                <td>{this.props.description}</td>
                <td>{this.props.date}</td>
                <td><ItemsList itemsListHeader='Guests' /></td>
                <td><ItemsList itemsListHeader='Need Things' /></td>
                <td>
                    <div>
                        <button onClick={() => this.redactHandleClick()}>Redact</button>
                        <button onClick={() => this.deleteHandleClick()}>Delete</button>
                    </div>
                </td>
            </tr>
        )
    }

    redactHandleClick() {
        console.log("Redact Click on : ", this.props.codeName);
    }
    deleteHandleClick() {
        console.log("Delete Click on : ", this.props.codeName);
    }
}

export default TableRow;
